import ManageData from './components/ManageData'


function App() {
  return (
    <div className="App">
        <div>
          <ManageData/>
          <Temp/>
          <h1 style={{marginTop: 50}}>COVID-19</h1>
          <USAData/>
          <BubbleChart />
        </div>
    </div>
  );
}

export default App;
